import React, { Component } from 'react';
import { connect } from 'react-redux';



class ArtPage extends Component {
    // Renders the entire app on the DOM


    render() {
      console.log('this is a clear page with clear objectives');


        return (
           <div>
                <ul>
                   <li>{this.props.classes.cardText} variant='body1'>Kingdom: {p.kingdom}</li>
                   <li>{this.props.classes.cardText} variant='body1'>Clade: {p.clade}</li>
                   <li>{this.props.classes.cardText} variant='body1'>Order: {p.order}</li>
                   <li>{this.props.classes.cardText} variant='body1'>Family: {p.family}</li>
                   <li>{this.props.classes.cardText} variant='body1'>Subfamily: {p.subfamily}</li>
                   <li>{this.props.classes.cardText} variant='body1'>Genus: {p.genus}</li>



                </ul>
           </div>
        );
    }
}

const mapReduxStateToProps = (reduxState) => {
    return reduxState;
}


export default connect(mapReduxStateToProps)(ArtPage);
